import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Interact with the search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Electronics');

    // Click the search button
    await page.waitForSelector('.search-btn', { timeout: 5000 });
    await page.click('.search-btn');

    // Take screenshot after search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Interact with a category card
    await page.waitForSelector('.category-card', { timeout: 5000 });
    await page.click('.category-card');

    // Take screenshot after clicking category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_category_selected.png'));

    // Extract some data to verify task completion
    const extractedData = await page.evaluate(() => {
      return {
        title: document.title,
        firstProduct: document.querySelector('.product-title') ? document.querySelector('.product-title').innerText : null
      };
    });

    return {
      success: true,
      action: "Performed search and selected a category",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
